var dump = function (arr,level) {
    var dumped_text = "";
    if(!level) level = 0;

    if(typeof(arr) == 'object') { //Array/Hashes/Objects
        dumped_text += "{";
        for(var item in arr) {
            var value = arr[item];
            dumped_text += "'" + item + "': " + dump(value, level + 1) + ", ";
            
        }
        dumped_text = dumped_text.slice(0, -2);
        /*if (arr.length>0) {
            dumped_text = dumped_text.slice(0, -2) + "blaaa";
        }
        else {
            dumped_text += "kruu";
        }*/
        dumped_text += "}";
    } else { //Stings/Chars/Numbers etc.
        dumped_text = "'" + arr + "'";
    }
    return dumped_text;
}

