        var strokePolygons = [];
        var strokeGestures = [];
        var strokes = [];

       // alert(numSegements,"numSegements");
        //1. construct an array of polygons, one for each stroke
        for (var i = 0; i < numSegements; i ++)
        {
            //determine convex hull of each stroke.  If hull overlaps with previous stroke, group it will that one.
            var strokePolygon = new Polygon();
            //deep copy
            var strokePoints =  drawnGesture.strokes[i].slice(0);
            strokePolygon.points = strokePoints;
            var debugString = "";
            strokePolygon.sortPoints();
            
            //get simple convex polygon of stroke
            strokePolygon.chainHull();
//            strokePolygon.monotoneHull();
//            strokePolygon.drawOnNewCanvas(MAIN_CONTAINER_ID, fixedPoint, debugString);                

            var strokeGesture = new Gesture();

            //deep copy of unadulterated points
            strokeGesture.strokes[0] = Point.clonePoints(drawnGesture.strokes[i]);
            
            strokePolygons.push(strokePolygon);
            strokeGestures.push(strokeGesture);
        }


        //2. loop through all polygons and find overlapping polygons        
        //3. group all overlapping polygons as strokes of a single gesture
        for (var i = 0; i < strokePolygons.length; i ++)
        {
            var strokePolygon2 = strokePolygons[i];
            var strokeGesture2 = strokeGestures[i];
            
            //determine if this stroke polygon overlaps any previous stroke polygon
            var haveOverlap = false;
            for (var j = 0; j < i; j ++)
            {
                var strokePolygon1 = strokePolygons[j];
                var strokeGesture1 = strokeGestures[j];
                var pi = new PolygonIntersect();
                //if there's any intersection, group together

                //deep copy points to leave originals unscaled
                var points1 = strokePolygon1.points.slice(0);
                var points2 = strokePolygon2.points.slice(0);

                //scale up a little to decrease gap/overlap tolerance
                var scaleFactor = 1.005;
                Point.scalePoints(points1, scaleFactor);
                Point.scalePoints(points2, scaleFactor);
                
                if (pi.intersection(points1, points2))
                {
                   // console.log(i, "intersection with", j);
                    
                    //append  points from strokePolygon2 as a new stroke of gesture1
                    strokeGesture1.strokes.push(strokeGesture2.strokes[0]);
                    //append points from strokePolygon2 to strokePolygon1                    
                    strokePolygon1.points = strokePolygon1.points.concat(strokePolygon2.points);
                    
                    //append strokePolygon2 points to gesture
                    
                    //remove strokeGesture2 from the stack
                    strokeGestures.splice(i, 1);
                    //...and remove strokePolygon2 from the stack
                    strokePolygons.splice(i, 1);
                    
                    i -= 2;
                }                
            }
        }

        var previousMatch = null;
        for (var i = 0; i < strokeGestures.length; i ++)
        {
            var strokeGesture = strokeGestures[i];
            //append segmented, but otherwise unmodified strokes to Ink object, mainly useful for UI stuff
            
            //clone gesture
            var inkStrokeGesture = strokeGesture.clone();
            //add original sroke indices
            //normalize
           // strokeGesture.scale(scaleFactor);        
           // strokeGesture.normalizeToFixedPoint(fixedPoint, true);        
           // strokeGesture.normalize();
            
            if (DEBUG_LEVEL > 0)
            {
                console.log("gestureStaffSize", gestureStaffSize);
                console.log("strokeGesture", strokeGesture);
            }
            var centroid =  strokeGesture.getAverageCenter();
            var topLeft = strokeGesture.getTopLeft();
            var textAlign = new Point(topLeft.x, staff.snapToLineY(centroid.y));
            //template match
            var matchList = this.match(strokeGesture, gestureStaffSize, previousMatch);

            inkStrokeGesture.matches = inkStrokeGesture.matches.concat(matchList);
            pencil.ink.gestures.push(inkStrokeGesture);

            var bestSymbol = matchList[0].gesture.symbol;
            var bestGesture = matchList[0].gesture;
            
            debugString = i + bestSymbol;
            var symbol = new Symbol(bestSymbol);
            symbol.position = textAlign;
            staff.symbols.push(symbol);
            pencil.redrawCanvas();
            
            previousMatch = matchList[0];
            //staff.render(context);
            
            //staff.drawSymbol(context, textAlign, bestSymbol);
//            strokeGesture.drawGestureOnNewCanvas(MAIN_CONTAINER_ID, debugString);                
            
        }

        
/*
 
        if (haveOverlap)
        {
            var overlappingPolygon = prevPolygons[j];
            //concatenate stroke points with points of overlapping polygon
            overlappingPolygon.points = overlappingPolygon.points.concat(strokePoints);
            
            //add stroke to previous gesture
            //                var overlappingGesture = prevGestures[j];
            //                overlappingGesture.strokes.push(strokePoints);
        }
        else
        {                    
            //create a new gesture
            //               var strokeGesture = new Gesture();                    
            //               strokeGesture.strokes.push(strokePoints);
            //               prevGestures.push(strokeGesture);
        }
  */      
