    this.retrainGesture = function(replacementName, replacementGesture)
    {
        //alert("retrainGesture", replacementName, replacementGesture);
        for (var i = 0; i < _trainedGestures.length; i ++)
        {
            if (_trainedGestures[i].symbol == replacementName)
            {
                _trainedGestures[i].staffSize = replacementGesture.staffSize;
                _trainedGestures[i].strokes = replacementGesture.strokes;
                //console.log(replacementName, "now has", _trainedGestures[i].strokes);
                
                //normalize... TODO: abstract this out somewhere
                if ("staffSize" in _trainedGestures[i] && _trainedGestures[i].staffSize != NORMALIZED_STAFF_SIZE)
                {
                    _trainedGestures[i].scale(NORMALIZED_STAFF_SIZE / _trainedGestures[i].staffSize);
                }
                _trainedGestures[i].normalizeToFixedPoint(fixedPoint, false);            
                _trainedGestures[i].normalize();          
            }
        }                
    }

